    <h1>WArriors</h1>
    <p>გუნდის სრული სახელია <strong>Golden state warriors</strong> გუნდი შეიქმნა <b>1946</b> წელს California_ში მაისურის ფორმა როგორც ყოველთვის არის <u>ლურჯი, ყვითელი და შავი.</u>
    Warriors აქვს მოპოვებული 23 ტუტული და გუნდი დღემდე დომინანტობს ლიგაზე.</p>
